import React from 'react';

import './forum.style.scss'

const Forum = () => {
    return (
        <div className='forum'>
            <img src="{img}" alt="forum" className='img'/>
            <h4 className='text'><span>unbox forum</span> Lorem ipsum dolor sit amet consectetur adipisicing elit. Sit, recusandae quam.</h4>
            <div className='alert'>COMING <span>SOON</span>!!!</div>
        </div>
    )
} 

export default Forum;
